async function importSortLog() {
  // Clear existing data
  const { error: delError } = await supabase.from('jumpstart_sort_log').delete().neq('id', 0)
  if (delError) console.error('Delete error:', delError)
  else console.log('Cleared existing sort log')

  // Insert in batches of 500
  for (let i = 0; i < rows.length; i += 500) {
    const batch = rows.slice(i, i + 500)
    const { error } = await supabase.from('jumpstart_sort_log').insert(batch)
    if (error) console.error(`Batch ${i} error:`, error)
    else console.log(`Imported ${Math.min(i + 500, rows.length)} / ${rows.length}`)
  }
  console.log('Done!')
}

importSortLog()
